  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Washington
  Islands National Wildlife Refuges (Flattery Rocks, Quillayute Needles, and Copalis
  Rock National Wildlife Refuges) outlines Refuge accomplishments during the 1992
  calendar year. The report begins with a summary of the year's highlights and weather
  conditions. The report includes a planning section which discusses research and
  investigations. Refuge administration is outlined; information about personnel is
  given. Habitat management is also covered. The wildlife section of the report discusses
  endangered and threatened species, marsh birds and waterbirds, shorebirds, other
  migratory birds, other resident wildlife, and animal control. The public uses of
  the Refuge described in this report include wildlife observation and law enforcement.
  Equipment utilization and replacement is briefly described. Items of interest are
  provided at the end. Newspaper articles are attached.\",\n\t\"license_title\": \"License
